INSERT INTO `html_email_template` (`id`, `name`, `head_tag`, `body_start_tag`, `body_content`, `body_end_tag`) VALUES
(1, 'default', '<!-- https://raw.githubusercontent.com/TedGoas/Cerberus/master/cerberus-fluid.html -->\r\n<!DOCTYPE html>\r\n<html lang=\"en\" xmlns=\"http://www.w3.org/1999/xhtml\" xmlns:v=\"urn:schemas-microsoft-com:vml\" xmlns:o=\"urn:schemas-microsoft-com:office:office\">\r\n<head>\r\n    <meta charset=\"utf-8\"> <!-- utf-8 works for most cases -->\r\n    <meta name=\"viewport\" content=\"width=device-width\"> <!-- Forcing initial-scale shouldn\'t be necessary -->\r\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\"> <!-- Use the latest (edge) version of IE rendering engine -->\r\n    <meta name=\"x-apple-disable-message-reformatting\">  <!-- Disable auto-scale in iOS 10 Mail entirely -->\r\n    <meta name=\"format-detection\" content=\"telephone=no,address=no,email=no,date=no,url=no\"> <!-- Tell iOS not to automatically link certain text strings. -->\r\n    <title>__subject__</title> <!-- The title tag shows in email notifications, like Android 4.4. -->\r\n\r\n    <!-- Web Font / @font-face : BEGIN -->\r\n    <!-- NOTE: If web fonts are not required, lines 10 - 27 can be safely removed. -->\r\n\r\n    <!-- Desktop Outlook chokes on web font references and defaults to Times New Roman, so we force a safe fallback font. -->\r\n    <!--[if mso]>\r\n        <style>\r\n            * {\r\n                font-family: sans-serif !important;\r\n            }\r\n        </style>\r\n    <![endif]-->\r\n\r\n    <!-- All other clients get the webfont reference; some will render the font and others will silently fail to the fallbacks. More on that here: http://stylecampaign.com/blog/2015/02/webfont-support-in-email/ -->\r\n    <!--[if !mso]><!-->\r\n    <!-- insert web font reference, eg: <link href=\'https://fonts.googleapis.com/css?family=Roboto:400,700\' rel=\'stylesheet\' type=\'text/css\'> -->\r\n    <!--<![endif]-->\r\n\r\n    <!-- Web Font / @font-face : END -->\r\n\r\n    <!-- CSS Reset : BEGIN -->\r\n    <style>\r\n\r\n        /* What it does: Remove spaces around the email design added by some email clients. */\r\n        /* Beware: It can remove the padding / margin and add a background color to the compose a reply window. */\r\n        html,\r\n        body {\r\n            margin: 0 auto !important;\r\n            padding: 0 !important;\r\n            height: 100% !important;\r\n            width: 100% !important;\r\n        }\r\n\r\n        /* What it does: Stops email clients resizing small text. */\r\n        * {\r\n            -ms-text-size-adjust: 100%;\r\n            -webkit-text-size-adjust: 100%;\r\n        }\r\n\r\n        /* What it does: Centers email on Android 4.4 */\r\n        div[style*=\"margin: 16px 0\"] {\r\n            margin: 0 !important;\r\n        }\r\n\r\n        /* What it does: forces Samsung Android mail clients to use the entire viewport */\r\n        #MessageViewBody, #MessageWebViewDiv{\r\n            width: 100% !important;\r\n        }\r\n\r\n        /* What it does: Stops Outlook from adding extra spacing to tables. */\r\n        table,\r\n        td {\r\n            mso-table-lspace: 0pt !important;\r\n            mso-table-rspace: 0pt !important;\r\n        }\r\n\r\n        /* What it does: Fixes webkit padding issue. */\r\n        table {\r\n            border-spacing: 0 !important;\r\n            border-collapse: collapse !important;\r\n            table-layout: fixed !important;\r\n            margin: 0 auto !important;\r\n        }\r\n\r\n        /* What it does: Uses a better rendering method when resizing images in IE. */\r\n        img {\r\n            -ms-interpolation-mode:bicubic;\r\n        }\r\n\r\n        /* What it does: Prevents Windows 10 Mail from underlining links despite inline CSS. Styles for underlined links should be inline. */\r\n        a {\r\n            text-decoration: none;\r\n        }\r\n\r\n        /* What it does: A work-around for email clients meddling in triggered links. */\r\n        a[x-apple-data-detectors],  /* iOS */\r\n        .unstyle-auto-detected-links a,\r\n        .aBn {\r\n            border-bottom: 0 !important;\r\n            cursor: default !important;\r\n            color: inherit !important;\r\n            text-decoration: none !important;\r\n            font-size: inherit !important;\r\n            font-family: inherit !important;\r\n            font-weight: inherit !important;\r\n            line-height: inherit !important;\r\n        }\r\n\r\n        /* What it does: Prevents Gmail from displaying a download button on large, non-linked images. */\r\n        .a6S {\r\n            display: none !important;\r\n            opacity: 0.01 !important;\r\n        }\r\n\r\n        /* What it does: Prevents Gmail from changing the text color in conversation threads. */\r\n        .im {\r\n            color: inherit !important;\r\n        }\r\n\r\n        /* If the above doesn\'t work, add a .g-img class to any image in question. */\r\n        img.g-img + div {\r\n            display: none !important;\r\n        }\r\n\r\n        /* What it does: Removes right gutter in Gmail iOS app: https://github.com/TedGoas/Cerberus/issues/89  */\r\n        /* Create one of these media queries for each additional viewport size you\'d like to fix */\r\n\r\n        /* iPhone 4, 4S, 5, 5S, 5C, and 5SE */\r\n        @media only screen and (min-device-width: 320px) and (max-device-width: 374px) {\r\n            u ~ div .email-container {\r\n                min-width: 320px !important;\r\n            }\r\n        }\r\n        /* iPhone 6, 6S, 7, 8, and X */\r\n        @media only screen and (min-device-width: 375px) and (max-device-width: 413px) {\r\n            u ~ div .email-container {\r\n                min-width: 375px !important;\r\n            }\r\n        }\r\n        /* iPhone 6+, 7+, and 8+ */\r\n        @media only screen and (min-device-width: 414px) {\r\n            u ~ div .email-container {\r\n                min-width: 414px !important;\r\n            }\r\n        }\r\n\r\n    </style>\r\n\r\n    <!-- What it does: Makes background images in 72ppi Outlook render at correct size. -->\r\n    <!--[if gte mso 9]>\r\n    <xml>\r\n        <o:OfficeDocumentSettings>\r\n            <o:AllowPNG/>\r\n            <o:PixelsPerInch>96</o:PixelsPerInch>\r\n        </o:OfficeDocumentSettings>\r\n    </xml>\r\n    <![endif]-->\r\n\r\n    <!-- CSS Reset : END -->\r\n\r\n    <!-- Progressive Enhancements : BEGIN -->\r\n    <style>\r\n\r\n	    /* What it does: Hover styles for buttons */\r\n	    .button-td,\r\n	    .button-a {\r\n	        transition: all 100ms ease-in;\r\n	    }\r\n	    .button-td-primary:hover,\r\n	    .button-a-primary:hover {\r\n	        background: #555555 !important;\r\n	        border-color: #555555 !important;\r\n	    }\r\n\r\n	    /* Media Queries */\r\n	    @media screen and (max-width: 600px) {\r\n\r\n	        /* What it does: Adjust typography on small screens to improve readability */\r\n	        .email-container p {\r\n	            font-size: 17px !important;\r\n	        }\r\n\r\n	    }\r\n\r\n    </style>\r\n    <!-- Progressive Enhancements : END -->\r\n\r\n</head>', '<!--\n    The email background color (#222222) is defined in three places:\n    1. body tag: for most email clients\n    2. center tag: for Gmail and Inbox mobile apps and web versions of Gmail, GSuite, Inbox, Yahoo, AOL, Libero, Comcast, freenet, Mail.ru, Orange.fr\n    3. mso conditional: For Windows 10 Mail\n-->\n<body width=\"100%\" style=\"margin: 0; padding: 0 !important; mso-line-height-rule: exactly; \">\n    <center style=\"width: 100%; \">\n    <!--[if mso | IE]>\n    <table role=\"presentation\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" >\n    <tr>\n    <td>\n    <![endif]-->\n\n        <!-- Visually Hidden Preheader Text : BEGIN -->\n        <div style=\"display: none; font-size: 1px; line-height: 1px; max-height: 0px; max-width: 0px; opacity: 0; overflow: hidden; mso-hide: all; font-family: sans-serif;\">__preheader__\n        </div>\n        <!-- Visually Hidden Preheader Text : END -->\n\n        <!-- Create white space after the desired preview text so email clients don’t pull other distracting text into the inbox preview. Extend as necessary. -->\n        <!-- Preview Text Spacing Hack : BEGIN -->\n        <div style=\"display: none; font-size: 1px; line-height: 1px; max-height: 0px; max-width: 0px; opacity: 0; overflow: hidden; mso-hide: all; font-family: sans-serif;\">\n            &zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;&zwnj;&nbsp;\n        </div>\n        <!-- Preview Text Spacing Hack : END -->\n\n        <!--\n            Set the email width. Defined in two places:\n            1. max-width for all clients except Desktop Windows Outlook, allowing the email to squish on narrow but never go wider than 600px.\n            2. MSO tags for Desktop Windows Outlook enforce a 600px width.\n        -->\n        <div style=\"max-width: 600px; margin: 0 auto;\" class=\"email-container\">\n            <!--[if mso]>\n            <table align=\"center\" role=\"presentation\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" width=\"600\">\n            <tr>\n            <td>\n            <![endif]-->\n\n            <!-- Email Body : BEGIN -->', '', '\r\n\r\n            <!--[if mso]>\r\n            </td>\r\n            </tr>\r\n            </table>\r\n            <![endif]-->\r\n        </div>\r\n\r\n\r\n    <!--[if mso | IE]>\r\n    </td>\r\n    </tr>\r\n    </table>\r\n    <![endif]-->\r\n    </center>\r\n</body>\r\n</html>');
